/*==============================================================================

FUNCTION TMD22QVGA_BOOT_SPLASH_SCREEN

DESCRIPTION
  This function will send an image to the primary LCD, without using
  any REX dependencies (tramp, timers, etc). 
  It is meant to be called:
    1) At boot time to put a "splash screen" on the LCD before the
       phone has completely booted.
    2) From within ERR_FATAL where we cannot depend on REX to
       be operating normally.

DEPENDENCY
  Requires display to be already initialized
  
==============================================================================*/
void  disp_epson_S1D19120_chg_fail_splash_screen (void)
{
#if 0//def FEATURE_BOOT_SPLASH_SCREEN
    disp_update(charging_failed_data, 130, 0, 0, 34, 130, 130, 56);
#endif
}


/*==============================================================================

FUNCTION TMD22QVGA_BOOT_SPLASH_SCREEN

DESCRIPTION
  This function will send an image to the primary LCD, without using
  any REX dependencies (tramp, timers, etc). 
  It is meant to be called:
    1) At boot time to put a "splash screen" on the LCD before the
       phone has completely booted.
    2) From within ERR_FATAL where we cannot depend on REX to
       be operating normally.

DEPENDENCY
  Requires display to be already initialized
  
==============================================================================*/
void disp_epson_S1D19120_boot_chg_splash_screen (void)
{
#ifdef FEATURE_BOOT_SPLASH_SCREEN
#if defined(FEATURE_PROJECT_W023C)
	disp_update(phone_charging_data, 80, 0, 0, 80, 80, 24, 40);
#elif defined(FEATURE_PROJECT_W021C)
	disp_update(phone_charging_data, 80, 0, 0, 80, 80, 24, 24);
#else
	disp_update(phone_charging_data, 134, 0, 0, 34, 134, 130, 56);
#endif
#endif  
}


